import React, { PureComponent } from "react";
import {
  BarChart,
  Bar,
  Cell,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ReferenceLine
} from "recharts";
import Card from "pnnl-react-core/lib/Card";

class LcsGraph extends PureComponent {
  constructor(props) {
    super(props);
    var lcs = this.props.data;

    this.data2 = [
      {
        name: "bin1",
        bin1: lcs[0],
        amt: 2400
      },
      {
        name: "bin2",
        bin2: lcs[1],
        amt: 2400
      },
      {
        name: "bin3",
        bin3: lcs[2],
        amt: 2400
      },
      {
        name: "bin4",
        bin4: lcs[3],
        amt: 2400
      },
      {
        name: "bin5",
        bin5: lcs[4],
        amt: 2400
      }
    ];
  }

  render() {
    return (
      <div>
        <BarChart
          width={500}
          height={300}
          data={this.data2}
          margin={{
            top: 5,
            right: 30,
            bottom: 5,
            left: 20
          }}
        >
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="name" />
          <YAxis />
          <Tooltip />
          <Legend />
          <ReferenceLine y={0} stroke="#000" />
          <Bar dataKey="bin1" fill="#b45c60" />
          <Bar dataKey="bin2" fill="#cb7761" />
          <Bar dataKey="bin3" fill="#cb824b" />
          <Bar dataKey="bin4" fill="#d7ad67" />
          <Bar dataKey="bin5" fill="#ac9a5d" />
        </BarChart>
      </div>
    );
  }
}

export default LcsGraph;
